from datetime import date
from typing import List, Dict

class DataProcessor:
    def __init__(self, data: List[Dict]):
        self.data = data

    def process_deletions(self, deletion_date: date):
        deletions = [item for item in self.data if item['deletion_date'] == deletion_date]
        for deletion in deletions:
            self.data.remove(deletion)
        return deletions

